INSERT INTO `static_contents` (`id`, `language`, `page_title`, `home_page_content`, `inner_page_content`, `page_meta_title`, `page_meta_description`, `created_at`, `updated_at`) VALUES
(1, '2', 'About NAS', '<p>National Achievement Survey (NAS) is a nationally representative large-scale survey of students\' learning undertaken by the Ministry of Education, Government of India. NAS gives a system level reflection on effectiveness of school education. Findings help compare the performance across spectrum and across population in order to find the desirable direction for improvements.</p>\r\n<p>National Achievement Survey-2021 is scheduled on 12th November 2021. The National Council of Educational Research and Training (NCERT) has developed the Assessment Framework for gauging the competencies attained by the students vis-a-vis learning outcomes.</p>', '<p>The Survey goes beyond the scorecard and includes the background variables to correlate student\'s performance in different learning outcomes vis-a-vis contextual variables. This national level survey would be conducted by the Central Board of Secondary Education (CBSE) as Assessment Administrator for Grade 3, 5, 8 and 10 students of State Govt. schools, Govt. Aided schools, Private Unaided recognized schools and Central Government schools. The Survey will be conducted in a monitored environment in the sampled schools. Sampling Design for NAS 2021 intends to support the predefined and agreed objectives of the national assessment, NAS 2021 intends to provide information of what India\'s students know and can do in key grades and subjects at national, state, district and school type. Selection of sampled schools is based on UDISE+2019-20 data. Therefore, the States, Districts used for drawing of the samples for NAS 2021 is exactly as per the UDISE+2019-20. NAS findings would help diagnose learning gaps of students and determine interventions required in education policies, teaching practices and learning. Through its diagnostic report cards, NAS findings help in capacity building for teachers, officials involved in the delivery of education. NAS 2021 would be a rich repository of evidences and data points furthering the scope of research and development. With this in view, NAS-2021 Portal has been developed by NIC as a dynamic platform in consultation with the NCERT, CBSE, UNICEF, DDG (Stats) and NITI Aayog under the overall guidance of Ministry of Education, Government of India. This portal would be a sustainable educational management information system both for helping in smooth conduct of NAS-2021 as well as for future decision-making based on data analytics. The portal provides role-based functionality and dashboard for managing the resources (various functionaries involved in the conduct &amp; administration of NAS), activity and event monitoring, capacity building, reporting &amp; documentation, post NAS analytical report in the customized formats.</p>', 'NATIONAL ACHIEVEMENT SURVEY-2021', 'About NAS', '2021-12-14 23:10:14', '2021-12-17 04:49:02'),
(6, '1', 'About NAS', '<p>राष्ट्रीय उपलब्धि सर्वेक्षण (एनएएस) शिक्षा मंत्रालय, भारत सरकार द्वारा किए गए छात्रों के सीखने का राष्ट्रीय स्तर पर प्रतिनिधि बड़े पैमाने पर सर्वेक्षण है। NAS स्कूली शिक्षा की प्रभावशीलता पर एक प्रणाली स्तरीय प्रतिबिंब देता है। सुधार के लिए वांछनीय दिशा खोजने के लिए निष्कर्ष पूरे स्पेक्ट्रम और आबादी में प्रदर्शन की तुलना करने में मदद करते हैं।</p>\r\n<p>राष्ट्रीय उपलब्धि सर्वेक्षण -2021 12 नवंबर 2021 को निर्धारित है। राष्ट्रीय शैक्षिक अनुसंधान और प्रशिक्षण परिषद (एनसीईआरटी) ने आकलन के लिए मूल्यांकन ढांचा विकसित किया है। सीखने के परिणामों की तुलना में छात्रों द्वारा प्राप्त दक्षताओं।</p>', '<p>सर्वेक्षण स्कोरकार्ड से आगे जाता है और इसमें पृष्ठभूमि के चर शामिल होते हैं जो विभिन्न सीखने के परिणामों में छात्र के प्रदर्शन को प्रासंगिक चर के साथ सहसंबंधित करते हैं। यह राष्ट्रीय स्तर का सर्वेक्षण केंद्रीय माध्यमिक शिक्षा बोर्ड (सीबीएसई) द्वारा राज्य सरकार के ग्रेड 3, 5, 8 और 10 के छात्रों के लिए मूल्यांकन प्रशासक के रूप में किया जाएगा। स्कूल, सरकार। सहायता प्राप्त स्कूल, गैर सहायता प्राप्त निजी स्कूल और केंद्र सरकार के स्कूल। सर्वेक्षण नमूने वाले स्कूलों में निगरानी के माहौल में किया जाएगा। NAS 2021 के लिए नमूना डिजाइन राष्ट्रीय मूल्यांकन के पूर्वनिर्धारित और सहमत उद्देश्यों का समर्थन करने का इरादा रखता है, NAS 2021 का उद्देश्य राष्ट्रीय, राज्य, जिला और स्कूल प्रकार के प्रमुख ग्रेड और विषयों में भारत के छात्र क्या जानते हैं और क्या कर सकते हैं, इसकी जानकारी प्रदान करना है। सैंपल किए गए स्कूलों का चयन UDISE+2019-20 डेटा पर आधारित है। इसलिए, NAS 2021 के लिए नमूने लेने के लिए उपयोग किए जाने वाले राज्य, जिले बिल्कुल UDISE+2019-20 के अनुसार हैं। NAS के निष्कर्ष छात्रों के सीखने के अंतराल का निदान करने और शिक्षा नीतियों, शिक्षण प्रथाओं और सीखने में आवश्यक हस्तक्षेपों को निर्धारित करने में मदद करेंगे। अपने डायग्नोस्टिक रिपोर्ट कार्ड के माध्यम से, NAS के निष्कर्ष शिक्षकों, शिक्षा के वितरण में शामिल अधिकारियों के लिए क्षमता निर्माण में मदद करते हैं। NAS 2021 अनुसंधान और विकास के दायरे को आगे बढ़ाने वाले साक्ष्यों और डेटा बिंदुओं का एक समृद्ध भंडार होगा। इसे ध्यान में रखते हुए, भारत सरकार के शिक्षा मंत्रालय के समग्र मार्गदर्शन में एनसीईआरटी, सीबीएसई, यूनिसेफ, डीडीजी (सांख्यिकी) और नीति आयोग के परामर्श से एनआईसी द्वारा एनएएस-2021 पोर्टल को एक गतिशील मंच के रूप में विकसित किया गया है। यह पोर्टल NAS-2021 के सुचारू संचालन में मदद करने के साथ-साथ डेटा एनालिटिक्स के आधार पर भविष्य के निर्णय लेने में मदद करने के लिए एक स्थायी शैक्षिक प्रबंधन सूचना प्रणाली होगी। पोर्टल संसाधनों के प्रबंधन के लिए भूमिका-आधारित कार्यक्षमता और डैशबोर्ड प्रदान करता है (एनएएस के संचालन और प्रशासन में शामिल विभिन्न अधिकारी), गतिविधि और घटना की निगरानी, ​​क्षमता निर्माण, रिपोर्टिंग और amp; दस्तावेज़ीकरण, अनुकूलित स्वरूपों में NAS विश्लेषणात्मक रिपोर्ट पोस्ट करें।</p>', 'राष्ट्रीय उपलब्धि सर्वेक्षण-2021', 'हमारे बारे में', '2021-12-16 02:07:54', '2021-12-16 03:44:26'),
